-- Database
-- if database exists drop it
USE master;
GO
IF DB_ID('teknikServisOtomasyonDB') IS NOT NULL
BEGIN
    ALTER DATABASE teknikServisOtomasyonDB SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
    DROP DATABASE teknikServisOtomasyonDB;
END
GO

-- create the database
CREATE DATABASE teknikServisOtomasyonDB;
GO

-- to query the database we created
USE teknikServisOtomasyonDB;
GO

-- Tables

CREATE TABLE Users (
    UserID INT PRIMARY KEY IDENTITY(1,1),
    Role NVARCHAR(20) NOT NULL
        CHECK (Role IN ('Customer', 'Staff', 'Admin', 'Accountant', 'Warehouse')),
    Email NVARCHAR(100) NOT NULL,
    PasswordHash NVARCHAR(255) NOT NULL,
    FirstName NVARCHAR(50) NOT NULL,
    LastName NVARCHAR(50) NOT NULL,
    Phone NVARCHAR(20) NOT NULL,
    CreatedAt DATETIME DEFAULT(GETDATE()),

    CONSTRAINT UQ_Users_Email UNIQUE (Email),
    CONSTRAINT UQ_Users_Phone UNIQUE (Phone)
);

CREATE TABLE ServiceRecords (
    ServiceID INT PRIMARY KEY IDENTITY(1,1),
    CustomerID INT NOT NULL,
    AssignedStaffID INT NULL,
    DeviceType NVARCHAR(50),
    Brand NVARCHAR(50),
    Model NVARCHAR(50),
    SerialNumber NVARCHAR(50),
    ProblemDescription NVARCHAR(MAX),
    Status NVARCHAR(50) NOT NULL CHECK (Status IN (
        'Talep Alındı',
        'Müşteriden Cihaz Bekleniyor',
        'Cihaz Kontrol Ediliyor',
        'Ücret Hesaplanıyor',
        'Ücret Onayı Bekleniyor',
        'İşlemde',
        'Teslime Hazır',
        'Tamamlandı',
        'Rapor Edildi',
        'İptal Edildi'
    )),
    CreatedAt DATETIME DEFAULT(GETDATE()),
    ClosedAt DATETIME NULL,
    Picture64 TEXT NOT NULL,
    FOREIGN KEY (CustomerID) REFERENCES Users(UserID),
    FOREIGN KEY (AssignedStaffID) REFERENCES Users(UserID)
);

CREATE TABLE ServiceOperations (
    OperationID INT PRIMARY KEY IDENTITY(1,1),
    ServiceID INT NOT NULL,
    Description NVARCHAR(MAX),
    Cost DECIMAL(10,2),
    PerformedAt DATETIME DEFAULT(GETDATE()),
    FOREIGN KEY (ServiceID) REFERENCES ServiceRecords(ServiceID)
);

CREATE TABLE ServiceComments (
    CommentID INT PRIMARY KEY IDENTITY(1,1),
    ServiceID INT NOT NULL,
    CustomerID INT NOT NULL,
    Rating INT CHECK (Rating BETWEEN 1 AND 5),
    CommentText NVARCHAR(MAX),
    CreatedAt DATETIME DEFAULT(GETDATE()),
    FOREIGN KEY (ServiceID) REFERENCES ServiceRecords(ServiceID),
    FOREIGN KEY (CustomerID) REFERENCES Users(UserID)
);

CREATE TABLE ServiceReports (   
    ReportID INT PRIMARY KEY IDENTITY(1,1),
    ServiceID INT NOT NULL,
    TechnicianID INT NOT NULL,
    Description NVARCHAR(MAX) NOT NULL,
    CreatedAt DATETIME DEFAULT(GETDATE()),
    FOREIGN KEY (ServiceID) REFERENCES ServiceRecords(ServiceID),
    FOREIGN KEY (TechnicianID) REFERENCES Users(UserID)
);

-- Constraints

    --ServiceOperations
ALTER TABLE ServiceOperations
DROP CONSTRAINT IF EXISTS FK__ServiceOp__Servi__;

ALTER TABLE ServiceOperations
ADD CONSTRAINT FK_ServiceOperations_ServiceRecords
FOREIGN KEY (ServiceID)
REFERENCES ServiceRecords(ServiceID)
ON DELETE CASCADE;

    --ServiceComments
ALTER TABLE ServiceComments
DROP CONSTRAINT IF EXISTS FK__ServiceCo__Servi__;

ALTER TABLE ServiceComments
ADD CONSTRAINT FK_ServiceComments_ServiceRecords
FOREIGN KEY (ServiceID)
REFERENCES ServiceRecords(ServiceID)
ON DELETE CASCADE;

    --ServiceReports
ALTER TABLE ServiceReports
DROP CONSTRAINT IF EXISTS FK__ServiceRe__Servi__;
 
ALTER TABLE ServiceReports
ADD CONSTRAINT FK_ServiceReports_ServiceRecords
FOREIGN KEY (ServiceID)
REFERENCES ServiceRecords(ServiceID)
ON DELETE CASCADE;


